import React from 'react';

const FaceRecognition = ({ imageUrl }) => {
    return (
        <div className='center'>
            <div>
                <img id='inputimage' alt='' src={imageUrl} width='500px' heigh='auto' />
            <div className='bounding-box'></div>
            </div>
        </div>
    )
}
export default FaceRecognition;
